function Navbar({}) {
    return (
      <nav> 
        <div>
            <Logo logo={"./images/the_phunk.jpg"}/>
        </div>
        <div>
        <NavItem title={"Home"} url={""}/>
        <NavItem title={"Blog"} url={""}/>
        <NavItem title={"Reviews"} url={""}/>
        <NavItem title={"Podcasts"} url={""}/>
        </div>
     </nav>
    );
}

function NavItem({title, url}){
    return (
      <a href={url}>
      {title}
      </a>
      );
  }

  function Logo({logo, size}){
    return(
      <img 
      src={logo}
      width={size}
      height={size}
      />
    )
  }
